import React from 'react';
import {BrowserRouter as BrowserRouterRouter, Route, Routes } from 'react-router-dom';
import Prolog from './component/Prolog';
import Login from './component/Login';
import Signup from './component/Signup';
import Test from './component/Test';
import Main from './component/Main';
import Message from './component/MessagePage';

function App(){
  return(
    <BrowserRouterRouter>
      <Routes>
        <Route path="/" element={<Prolog />} />
        <Route path="/Login" element={<Login />} />
        <Route path="/Test" element={<Test />}/>
        <Route path="/Signup" element={<Signup />} />
        <Route path="/Main" element={<Main />} />
        <Route path="/Main/MessagePage'" element={<MaMessage />} />
      </Routes>
    </BrowserRouterRouter>
  );
}

export default App;
